import 'package:http/http.dart' as http;

class Endpoints {

  // The base url
  static const String baseUrl = "http://192.168.0.29:3000";

  // Logon
  static String logon() {
    return "${Endpoints.baseUrl}/user_token";
  }

  // Add comment
  static String addComment() {
    return "${Endpoints.baseUrl}/comments.json";
  }

  // Add review
  static String addReview() {
    return "${Endpoints.baseUrl}/reviews.json";
  }

  // Get wines
  static Future wines() async {
    var url = "${Endpoints.baseUrl}/wines.json";
    return http.get(url);
  }

  // Get wine
  static String wine(int wineId) {
    return "${Endpoints.baseUrl}/wines/$wineId.json";
  }

  // Get reviews
  static Future reviews(int wineId) async {
    var url = "${Endpoints.baseUrl}/wines/$wineId/reviews.json";
    return http.get(url);
  }

  // Get comments
  static Future comments(int wineId) async {
    var url = "${Endpoints.baseUrl}/wines/$wineId/comments.json";
    return http.get(url);
  }

  // Send scanned wine
  static String sendScan() {
    return "http://192.168.0.29:5000/scan";
  }

  static String getImgB64() {
    return "";
  }
}